import React from "react";
import { motion } from "framer-motion";
import img from "./../../asstes/portfolio/Rectangle 15.png";
import "./portfolio.css";

export const Portfolio = () => {
  return (
    <section className="pb-12 pt-20  dark:bg-dark lg:pb-[90px] lg:pt-[120px] ">
      <div className="container mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
        <div className="-mx-4 flex flex-wrap">
          <div className="w-full px-4">
            <div className=" mb-12 max-w-[510px]  lg:mb-20 ">
              <span className="mb-2 block text-lg font-semibold portfolio-name">
                VISIT MY PORTFOLIO AND KEEP YOUR FEEDBACK
              </span>
              <h2 className="text-5xl portfolio-text">My Portfolio</h2>
            </div>
          </div>
        </div>

        <div className="-mx-4 flex flex-wrap">
          <ServiceCard
            details="NFT Dashboard Application Development"
            icon={<img src={img} />}
          />
          <ServiceCard
            details="Online Food Delivery Mobile web Design & web devolopment. "
            icon={<img src={img} />}
          />
          <ServiceCard
            details="Travel App Design Creativity & Application. "
            icon={<img src={img} />}
          />
          <ServiceCard
            details="website using reactjs and frameworks "
            icon={<img src={img} />}
          />
          <ServiceCard
            details="Workout Website Design And Development."
            icon={<img src={img} />}
          />
          <ServiceCard
            details="Restaurant Mobile Application Figma Design."
            icon={<img src={img} />}
          />
        </div>
      </div>
    </section>
  );
};

const ServiceCard = ({ icon, title, details }) => {
  return (
    <>
      <div className="w-full px-4 md:w-1/2 lg:w-1/3 ">
        <div className="mb-9 rounded-[20px]  portfolio-card p-10 shadow-2  dark:bg-dark-2 md:px-7 xl:px-10">
          <motion.div>
            <div className="mb-8 flex h-[250px] w-[250px] items-center justify-center rounded-2xl ">
              {icon}
            </div>
            <p className="text-body-color dark:text-dark-6">{details}</p>
          </motion.div>
        </div>
      </div>
    </>
  );
};
